import React, { useState, useEffect } from 'react'; 
import Search from './searchfunction'; 
import './checklist.css'; 

const benefitsMapping = {
    'GI Bill': 'GI Bill',
    'Chapter 30': 'Chapter 30',
    'Chapter 31 VocRehab (must have authorization from VocRehab Counselor)': 'Chapter 31',
    'Chapter 33 Post 9/11 (must submit a COE)': 'Chapter 33 Post 911',
    'Chapter 35': 'Chapter 35',
    'Fed TA': 'Fed TA',
    'State TA': 'State TA',
    'Missouri Returning Heroes (must have DD214 on file or supporting documentation submitted to UMSL Veterans Center)': 'Missouri Returning Heroes',
};

// Priority mapping
const benefitPriority = {
    'GI Bill': 1,
    'Chapter 30': 2,
    'Chapter 31': 3,
    'Chapter 33 Post 911': 4,
    'Chapter 35': 5,
    'Fed TA': 6,
    'State TA': 7,
    'Missouri Returning Heroes': 8,
};

const requiredDocsMapping = {
    'GI Bill': ['COE', 'Enrollment Manager', 'Schedule'],
    'Chapter 30': ['COE', 'Enrollment Manager', 'Schedule'],
    'Chapter 31': ['Authorization from VocRehab Counselor', 'Enrollment Manager', 'Schedule'],
    'Chapter 33 Post 911': ['COE', 'Enrollment Manager', 'Schedule'],
    'Chapter 35': ['COE', 'Enrollment Manager', 'Schedule'],
    'Fed TA': ['TAR', 'Enrollment Manager', 'Schedule'],
    'State TA': ['Award Letter', 'Enrollment Manager', 'Schedule'],
    'Missouri Returning Heroes': ['DD214', 'Enrollment Manager', 'Schedule'],
};

const SecurePage = () => {
    const [data, setData] = useState([]);
    const [searchTerm, setSearchTerm] = useState('');

    // Function to fetch data from the server
    const fetchData = async () => {
        try {
            const response = await fetch('http://localhost:3000/api/data/scan');
            const result = await response.json();
            setData(result);
        } catch (error) {
            console.error('Error fetching data:', error);
        }
    };

    // Load data on component mount
    useEffect(() => {
        fetchData();
    }, []);

    // Filter data based on search term
    const filteredData = data.filter((item) => {
        const fullName = item["Last Name, First Name (Legal Name)"];
        if (!fullName) return false;

        const [lastName, firstName] = fullName.split(',').map(name => name.trim());
        const displayName = `${firstName} ${lastName}`;

        return displayName.toLowerCase().startsWith(searchTerm.toLowerCase());
    });

    // Get highest-priority benefit from a list of benefits
    const getHighestPriorityBenefit = (benefitString) => {
        if (typeof benefitString !== 'string') {
            return ''; // Return empty string if not a string
        }

        const benefitsArray = benefitString.split(';').map(b => benefitsMapping[b.trim()] || b.trim());
        let highestPriorityBenefit = '';
        let highestPriority = Infinity;

        for (const benefit of benefitsArray) {
            const priority = benefitPriority[benefit];
            if (priority && priority < highestPriority) {
                highestPriority = priority;
                highestPriorityBenefit = benefit;
            }
        }

        return highestPriorityBenefit || 'No benefits available';
    };

    // Get required documents based on benefits
    const getRequiredDocs = (benefit) => {
        return requiredDocsMapping[benefit] ? requiredDocsMapping[benefit].join(', ') : 'No required documents';
    };

    return (
        <div className="secure-page">
            <div className="content">
                <img src="https://i.imgur.com/YIChrEK.png" alt="Company Logo" />
                <h1>Welcome to the Secure Page</h1>
                <p>Click the "Scan" button to display data.</p>

                {/* Search component */}
                <Search searchTerm={searchTerm} setSearchTerm={setSearchTerm} />

                {filteredData.length > 0 ? (
                    <table>
                        <thead>
                            <tr>
                                <th className="red-header">Name</th>
                                <th className="red-header">Student ID</th>
                                <th className="red-header">Benefit</th>
                                <th className="red-header">Required Documents</th>
                            </tr>
                        </thead>
                        <tbody>
                            {filteredData.map((item, index) => {
                                const fullName = item["Last Name, First Name (Legal Name)"] || 'Unknown';
                                const [lastName, firstName] = fullName.split(',').map(name => name.trim());
                                const displayName = `${firstName} ${lastName}`;
                                const benefits = item["Benefit you plan to utilize this term (check all that apply):"] || '';

                                const highestBenefit = getHighestPriorityBenefit(benefits);

                                return (
                                    <tr key={index}>
                                        <td>{displayName}</td>
                                        <td>{item["Student ID # (This is NOT your Social Security Number or SSO ID)"] || 'N/A'}</td>
                                        <td>{highestBenefit}</td>
                                        <td>{getRequiredDocs(highestBenefit)}</td>
                                    </tr>
                                );
                            })}
                        </tbody>
                    </table>
                ) : (
                    <p>No veterans matching search</p>
                )}
            </div>
        </div>
    );
};

export default SecurePage;
